import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { Link } from 'react-router-dom';
// import '../css/perfil.css';

const Perfil = () => {
  const { id } = useParams();
  const [user, setUser] = useState(null);

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const response = await fetch(`http://localhost:3002/usuario/${id}`);
        const data = await response.json();
        setUser(data);
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };

    fetchUser();
  }, [id]);
  console.log(id)

  if (!user) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <div className='head'>
        icono de sandwich con las opciones, icono de lupita para buscador
      </div>
      <div className='body'>
        <div>
          {user.Proveedor ? (
            <>
              <img src={user.Proveedor.linkCatalogo} alt="Perfil" />
              <h1>{user.email}</h1>
              <div>
                <a href={user.Proveedor.linkInstagram}>Instagram</a>
                <a href={user.Proveedor.linkFacebook}>Facebook</a>
                <a href={user.Proveedor.linkWeb}>Sitio Web</a>
              </div>
              <h2>Presentación</h2>
              <p>{user.Proveedor.presentacion}</p>
              <h2>Servicios que ofrece</h2>
              <ul>
                {user.Proveedor.CategoriaProveedors.map((categoria, index) => (
                  <li key={index}>{categoria.categoria}</li>
                ))}
              </ul>
              <h2>Contacto</h2>
              <p>Tel: {user.Proveedor.tel}</p>
              <h2>Ubicación</h2>
              <p>{user.ubicacion}</p>
              <h2>Pedir catálogo</h2>
              <a href={`https://wa.me/?text=${encodeURIComponent(user.Proveedor.linkCatalogo)}`}>WhatsApp</a>
              <h2>Pedir lista de precios</h2>
              <a href={`https://wa.me/?text=${encodeURIComponent(user.Proveedor.linkCatalogo)}`}>WhatsApp</a>
            </>
          ) : (
            <>
              <h1>{user.email}</h1>
              <div>
                <a href={user.Comerciante.linkInstagram}>Instagram</a>
                <a href={user.Comerciante.linkFacebook}>Facebook</a>
                <a href={user.Comerciante.linkWeb}>Sitio Web</a>
              </div>
              <h2>Presentación</h2>
              <p>{user.Comerciante.presentacion}</p>
              <h2>Servicios que ofrece</h2>
              <ul>
                {user.Comerciante.CategoriaComerciantes.map((categoria, index) => (
                  <li key={index}>{categoria.categoria}</li>
                ))}
              </ul>
              <h2>Contacto</h2>
              <p>Tel: {user.Comerciante.tel}</p>
              <h2>Ubicación</h2>
              <p>{user.ubicacion}</p>
              <h2>Pedir catálogo</h2>
              <a href={`https://wa.me/?text=${encodeURIComponent(user.Comerciante.linkWeb)}`}>WhatsApp</a>
              <h2>Pedir lista de precios</h2>
              <a href={`https://wa.me/?text=${encodeURIComponent(user.Comerciante.linkWeb)}`}>WhatsApp</a>
            </>
          )}
        </div>
      </div>
    </div>
  );
}

export default Perfil;
